import React from 'react'
import './style.css';

const Message = ({ message }) => {
  return (
    <>
      {message.isBot ? (
        <div className="">
          <div
            className=""
          >
            <span>
              {message.text}
            </span>
          </div>
          <i className="" />
        </div>
      ) : (
        <div className="">
          <div
            className="">
            <span
              className=""
            >
              {message.text}
            </span>
          </div>
          <i className="fas fa-user w-6 h-6 dark:text-white  rounded-full order-1" />
        </div>
      )}
    </>
  )
}

export default Message
